package pkcs7

import (
	"encoding/base64"
	"testing"
)

func TestParse(t *testing.T) {
	data, err := base64.StdEncoding.DecodeString("")
	if err != nil {
		t.Error(err)
		t.FailNow()
	}
	p7, err := Parse(data)
	if err != nil {
		t.Error(err)
		t.FailNow()
	}
	if p7.Signers == nil {
		t.Error(err)
		t.FailNow()
	}

	data, err = base64.StdEncoding.DecodeString("")
	if err != nil {
		t.Error(err)
		t.FailNow()
	}
	p7, err = Parse(data)
	if err != nil {
		t.Error(err)
		t.FailNow()
	}
	if p7.Signers == nil {
		t.Error(err)
		t.FailNow()
	}

}
